// Input: Array of Slack message items with a "text" field
// Output: Single item with the combined text field

const combinedText = items
  .map(item => item.json.text || '')
  .filter(text => text.trim() !== '') // Optional: remove empty texts
  .join('\n'); // Combine with newlines, use ',' or ' ' if preferred

return [{
  json: {
    combinedText,
  }
}];

